    n = int(stdin.split()[0])
    friends = list(map(int, stdin.split()[1:]))

    # Create a graph with n vertices and n-1 edges
    graph = [[] for _ in range(n)]
    for i, j in enumerate(friends):
        if j!= 0:
            graph[j - 1].append(i)

    # Initialize the degrees of each vertex
    degrees = [0] * n
    for edge in graph:
        for vertex in edge:
            degrees[vertex] += 1

    # BFS to find the strongly connected components
    def bfs(vertex):
        nonlocal degrees
        visited = [False] * n
        visited[vertex] = True
        queue = [vertex]
        while queue:
            current = queue.pop(0)
            for neighbor in graph[current]:
                if not visited[neighbor]:
                    visited[neighbor] = True
                    queue.append(neighbor)
                    degrees[neighbor] -= 1
                    if degrees[neighbor] == 0:
                        return neighbor
        return -1

    def dfs(vertex):
        nonlocal result
        result.append(vertex + 1)
        visited[vertex] = True
        for neighbor in graph[vertex]:
            if not visited[neighbor]:
                dfs(neighbor)

    # Find the strongly connected components
    components = set()
    for i in range(n):
        if degrees[i] == 0:
            components.add(bfs(i))

    # Check if there is a contradiction
    for component in components:
        if len(component) > 1 and component[0] == component[-1]:
            continue
        for i, j in zip(component, component[1:]):
            if j == i + 1:
                continue
            return "Impossible"

    # Find the answer
    result = []
    for component in components:
        dfs(component[0])
        result.append(result.pop(0) * len(component))

    return " ".join(map(str, result))

