    def bfs(start: int) -> List[int]:
        queue = deque([(start, 0)])
        visited = set()
        dist = [float('inf')] * n
        dist[start] = 0

        while queue:
            curr, cost = queue.popleft()
            if curr in visited:
                continue
            visited.add(curr)

            for next_node, cost_to_next in edges:
                if next_node == curr:
                    continue
                if dist[next_node] > dist[curr] + cost_to_next:
                    dist[next_node] = dist[curr] + cost_to_next
                    queue.append((next_node, dist[next_node]))

        return dist

    def dfs(node: int, path: List[int]) -> Tuple[int, List[int]]:
        if node == n - 1:
            return a[node], path

        dist = min(dist[node] + a[node], dist[path[-1]])
        for next_node, cost_to_next in edges:
            if next_node == node:
                continue
            if dist == dist[node] + cost_to_next:
                path.append(next_node)
                res, _ = dfs(next_node, path)
                if res!= float('inf'):
