def solution(stdin: str) -> str:
    import heapq
    from typing import List, Tuple

    n, m, k = map(int, stdin.split())
    edges = [tuple(map(int, stdin.split())) for _ in range(m)]

    graph = [[] for _ in range(n + 1)]
    for x, y, w in edges:
        graph[x].append((y, w))
        graph[y].append((x, w))

    def dijkstra(start: int) -> List[int]:
        min_heap = [(0, start)]
        distance = [float('inf')] * (n + 1)
        distance[start] = 0

        while min_heap:
            distance_to_current_node, current_node = heapq.heappop(min_heap)

            if distance_to_current_node > distance[current_node]:
                continue

            for neighbor, weight in graph[current_node]:
                new_distance = distance_to_current_node + weight

                if new_distance < distance[neighbor]:
                    distance[neighbor] = new_distance
                    heapq.heappush(min_heap, (new_distance, neighbor))

        return distance

    def kth_smallest_shortest_path(start: int) -> Tuple[int, int]:
        shortest_path_matrix = [float('inf')] * (n + 1)
        shortest_path_matrix[start] = 0

        for i in range(1, n + 1):
            new_distance = dijkstra(i)
            for j in range(1, n + 1):
                if new_distance[j] < shortest_path_matrix[j]:
                    shortest_path_matrix[j] = new_distance[j]

        sorted_shortest_path_matrix = sorted(shortest_path_matrix)
        kth_element = sorted_shortest_path_matrix[k - 1]

        return kth_element, shortest_path_matrix

    kth_element, shortest_path_matrix = kth_smallest_shortest_path(1)

    return str(kth_element)

