    s = stdin.split()[1]
    # if all characters are L, there is no way to optimize the path
    if all(c == 'L' for c in s):
        return -1

    # create a set of all possible substrings of the path
    substrings = set()
    for i in range(n):
        for j in range(i+1, n+1):
            substrings.add(s[i:j])

    # find the shortest non-empty substring that doesn't change the endpoint
    min_length = float('inf')
    min_substring = None
    for substring in substrings:
        # check if the substring changes the endpoint
        if (substring.count('U') - substring.count('D')) % 2 == 1 or (substring.count('L') - substring.count('R')) % 2 == 1:
            continue

        # check if the substring is non-empty and shorter than the current shortest substring
        if len(substring) > 0 and len(substring) < min_length:
            min_length = len(substring)
            min_substring = substring

    # return the answer
    if min_substring is None:
        return -1
    else:
        return f"{min_substring.index('L')+1} {min_substring.index('R')+1}"

