    edges = []
    for _ in range(n - 1):
        u, v = map(int, stdin.split())
        edges.append((u - 1, v - 1))

    def bellman_ford(start: int) -> int:
        dist = [float('inf')] * n
        dist[start] = 0
        for _ in range(n - 1):
            for u in range(n):
                for v, w in edges:
                    if dist[u]!= float('inf') and dist[u] + w < dist[v]:
                        dist[v] = dist[u] + w
        return dist

    def dfs(u: int, path: list) -> None:
        path.append(u)
        for v, _ in edges:
            if v == u:
                continue
            dfs(v, path)
        path.pop()

    max_cost = float('-inf')
    for i in range(n):
        dist = bellman_ford(i)
        cost = sum(dist[u] * a[u] for u in range(n))
        if max_cost < cost:
            max_cost = cost
            best_path = []
            dfs(i, best_path)

    return str(max_cost)

