    # sort cookies by size in descending order
    cookie_sizes.sort(reverse=True)

    # initialize variables
    content_children = 0
    max_content = 0

    for i, gi in enumerate(greed_factors):
        # check if i is already a content child
        if content_children > 0:
            break

        # try to assign all cookies to the child with the highest greed factor
        for j, sj in enumerate(cookie_sizes):
            if sj >= gi and (content_children == 0 or sj > cookie_sizes[content_children - 1]):
                content_children += 1
                if content_children > max_content:
