    # This can be done using dynamic programming.
    dp = [[float('inf')] * (n + 1) for _ in range(m + 1)]

    # Initialize the dp table.
    dp[1][1] = 0
    for i in range(m - 1, -1, -1):
        for j in range(n - 1, -1, -1):
            if i == m - 1 and j == n - 1:
                dp[i][j] = heights[i][j] - 1
            else:
                if j + 1 < n and heights[i][j] < dp[i + 1][j + 1]:
                    dp[i][j] = dp[i + 1][j + 1]
                else:
                    dp[i][j] = heights[i][j]

    # Now that we have the dp table, we can find the shortest ladder that allows us to reach the south-east corner from the north-west corner.
    shortest_ladder = float('inf')
    for i in range(m + 1):
        for j in range(n + 1):
            if i == 0 or j == 0:
                continue
            if i == m and j == n:
                shortest_ladder = min(shortest_ladder, dp[i][j] + heights[i - 1][j - 1])
            elif i == m or j == n:
                shortest_ladder = min(shortest_ladder, dp[i][j] + heights[i - 1][j - 1])
