                    nx, ny = x + dx, y + dy
                    if (nx, ny) in intersections:
                        intersections.add((x, y))
                        break

    # Check if it is possible to travel to all intersections
    if len(intersections) < 2 or (c, d) not in intersections:
        return "N"

    # Check if it is possible to travel using exactly t units of charge
    used_charge = 0
    current_intersection = (a, b)
    for direction in directions:
        nx, ny = current_intersection[0] + direction[0], current_intersection[1] + direction[1]
        if (nx, ny) in intersections:
            if direction[0] == 0:
                if (ny, current_intersection[1]) in intersections:
                    if used_charge + abs(ny - current_intersection[1]) <= t:
                        current_intersection = (nx, ny)
            elif direction[1] == 0:
                if (current_intersection[0], nx) in intersections:
                    if used_charge + abs(nx - current_intersection[0]) <= t:
                        current_intersection = (nx, ny)
            used_charge += 1
            if used_charge == t:
                return "Y"

    return "N"

