                while q:
                    x, y = q.pop(0)
                    visited.add((x, y))
                    if image[x][y] == 'L' and (x, y-1) not in visited:
                        q.append((x, y-1))
                    elif image[x][y] == 'C' and (x-1, y) not in visited:
                        q.append((x-1, y))
                    elif image[x][y] == 'C' and (x+1, y) not in visited:
                        q.append((x+1, y))
                    elif image[x][y] == 'C' and (x, y+1) not in visited:
                        q.append((x, y+1))
                    elif image[x][y] == 'C' and (x, y-1) not in visited:
                        q.append((x, y-1))
                    elif image[x][y] == 'C' and (x, y+1) not in visited:
                        q.append((x, y+1))
                    elif image[x][y] == 'C' and (x-1, y-1) not in visited:
                        q.append((x-1, y-1))
                    elif image[x][y] == 'C' and (x-1, y+1) not in visited:
