def solution(stdin: str) -> str:
    points = stdin.strip().split("\n")[1:]
    points = list(map(lambda x: list(map(int, x.split(" "))), points))
    A = points[0]
    B = points[1]
    C = points[2]
    D = points[3]

    if A[0] * (B[1] - C[1]) == (B[0] - C[0]) * (A[1] - B[1]):
        return "Error: A, B, and C are collinear"

    if B[0] * (C[1] - D[1]) == (C[0] - D[0]) * (B[1] - C[1]):
        return "Error: B, C, and D are collinear"

    if C[0] * (D[1] - A[1]) == (D[0] - A[0]) * (C[1] - D[1]):
        return "Error: C, D, and A are collinear"

    if A[1] * (B[0] - C[0]) == (B[1] - C[1]) * (A[0] - B[0]):
        return "Error: A, B, and C are collinear"

    if B[1] * (C[0] - D[0]) == (C[1] - D[1]) * (B[0] - C[0]):
        return "Error: B, C, and D are collinear"

    if C[1] * (D[0] - A[0]) == (D[1] - A[1]) * (C[0] - D[0]):
        return "Error: C, D, and A are collinear"

    if A[0] * (B[1] - C[1]) == (B[0] - C[0]) * (A[1] - B[1]):
        return "Error: A, B, and C are collinear"

    if B[0] * (C[1] - D[1]) == (C[0] - D[0]) * (B[1] - C[1]):
        return "Error: B, C, and D are collinear"

    if C[0] * (D[1] - A[1]) == (D[0] - A[0]) * (C[1] - D[1]):
        return "Error: C, D, and A are collinear"

    x_right = min(A[0], min(B[0], C[0]))
    y_right = min(A[1], min(B[1], C[1]))
    x_left = max(A[0], max(B[0], C[0]))
    y_left = max(A[1], max(B[1], C[1]))

    if x_right == x_left and y_right == y_left:
        return "Error: All points are collinear"

